import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent {
  title = 'bootstrap-example';

  dateObj = new Date();
}
<div class="container">
  <div class="row">
    <div class="col">
      <h1>{{ dateObj }}</h1>
    </div>
  </div>
</div>

